class App extends Component {
  render() {
    return (
      <div style={{textAlign:'center'}}>
        <h1>My First Page</h1>
        <span>
          <input value={this.props.inputVaue} type="text"/>
          <button>+1</button>
        </span>
      </div>
    );
  }
}

export default App;
